declare module "classnames" {
    const classnames: {
        (...args: any[]): any
    }

    export default classnames;
}

declare module "react-loadable" {
    const Loadable: {
        (options: object): any
    }

    export default Loadable;
}

declare module 'string-template' {
    const template: {
        (template: string, ...args: any[]): string
    }

    export default template
}
